webpackJsonp([0xbf9f35f38579],{457:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Add static typing to JavaScript to improve developer productivity and code quality with <a href="https://www.typescriptlang.org/" target="_blank">TypeScript</a>.</p>\n<p>ReactiveSearch comes bundled with <a href="https://www.typescriptlang.org/docs/handbook/declaration-files/introduction.html" target="_blank">TypeScript definitions</a> for every component which checks types and signatures component props.</p>\n<h2 id="usage"><a href="#usage" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Usage</h2>\n<p>Take a look at the <a href="https://github.com/appbaseio-apps/reactivesearch-typescript" target="_blank">Create React App with TypeScript example</a> with ReactiveSearch.</p>\n<br/>\n<h4 id="love-typescript"><a href="#love-typescript" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Love TypeScript?</h4>\n<p>Help us maintain and improve our types <a href="https://github.com/appbaseio/reactivesearch/blob/dev/packages/web/src/types.ts" target="_blank">definition file</a> tracked under <a href="https://github.com/appbaseio/reactivesearch/issues/223" target="_blank">#223</a>. </p>',frontmatter:{title:"TypeScript Support",next:"comparison.html",prev:"writingdata.html",nextTitle:"Comparison with Other projects",prevTitle:"Writing and Editing Data"},fields:{path:"docs/advanced/typescript",slug:"advanced/typescript.html"}}},pathContext:{slug:"advanced/typescript.html"}}}});
